 (props: {
  prompt_projectRelativePath: string;
}) => {
  const { prompt_projectRelativePath } = props;

  const contextualPromptResultsQuery = queries.useGetContextualPromptResults({
    prompt_projectRelativePath,
  });

  return (
    <Div>
      {contextualPromptResultsQuery.data?.result?.map(
        (item: ContextualPromptResult) => {
          return (
            <Div>
              <b>prompt</b>
              {item.prompt ? (
                <MarkdownContent content={item.prompt} config={{}} />
              ) : null}

              <b>result</b>

              {item.resultText ? (
                <MarkdownContent content={item.resultText} config={{}} />
              ) : null}
            </Div>
          );
        }
      )}
    </Div>
  );
}
